import logo from './images/react-full.png';
function Header() {
  return (
    <header>
      <div>
        <img src={logo}></img>
      </div>
      <h1>Merchandise</h1>
      <nav>
        <ul>
          <li>Pricing</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </nav>
    </header>
  );
};

export { Header };
